uint8_t camera_point_check(const Byte* buff, int16_t x, int16_t y) {
	if (x > cam_width - 1 || x < 0 || y > cam_height - 1 || y < 0)
		return 2;
	int16_t col = transformMatrix[x][y][0];
	int16_t row = transformMatrix[x][y][1];
	if (col < 0 || col > 128 || row < 0 || row > 480)
		return 2;
	return ((buff[row * cam_width / 8 + col / 8] >> (7 - (col % 8))) & 1);
}

bool simple_camera_point_check(const Byte* buff, int16_t x, int16_t y) {
	if (x > cam_width - 1 || x < 0 || y > cam_height - 1 || y < 0)
		return true;
	int16_t col = transformMatrix[x][y][0];
	int16_t row = transformMatrix[x][y][1];
	if (col < 0 || col > 128 || row < 0 || row > 480)
		return true;
	return ((buff[row * cam_width / 8 + col / 8] >> (7 - (col % 8))) & 1);
}

